import React from "react";

function IndexBar() {
    return <div className="bottomNav" style={{ height: "52px" }}>
        <div className="bottomObj hovering" style={{ padding: "5px" }}>
            <img src="images/tables_icon.png" />
            <p style={{ margin: "0px 5px" }}>Table</p>
            <img src="images/down-arrow.png" style={{ width: "12px", height: "12px" }} />
        </div>
    </div>
}

export default IndexBar;
